import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);


import { BrowserRouter } from 'react-router-dom';

const rootElement = document.querySelector("#root");
ReactDOM.render(
  < BrowserRouter >
    <App />
  </ BrowserRouter >
  ,rootElement);
